import React from "react";
import "../stylesheets/SearchCard.css";
import annette from "../images/annette.jpg";

export default function SearchCard() {
    return (
        <div className="search-card">
            <img className="search-card-image" src={annette} alt="annette" />
            <div className="search-card-description">
                <div className="search-card-title">Annette</div>
                <div className="search-card-year">Released in 7 Jul, 2021</div>
                <div className="search-card-director">Directed by Leos Carax</div>
            </div>
        </div>
    )
}
